// SPDX-License-Identifier: MIT
pragma solidity 0.8.13;
// changed pragma solidity version

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";

contract STFounderCollection is ERC721 
{
    address public admin;
    bool public allowTransfer = false;
    uint256 public tokenCount = 0;
    uint256 public totalSupply = 1000;

    // map ID to the number of people who have refered
    mapping (uint256 => uint256) public referrals;

    // ID -> email
    mapping (uint256 => string) public _id2email;

    // email -> ID
    mapping (string => uint256) public _email2id;

    // address -> ID
    mapping (address => uint256) public _address2id;

    constructor() ERC721("ST Founder Medal", "STFM") 
    { 
        admin = msg.sender;
    }

    function mintWithReferral(string memory _email, string memory _referral) external returns(uint256)
    {
        require(tokenCount <= totalSupply, "Token Cap reached. Contact bell@st.world.");
        require(keccak256(bytes(_email)) != keccak256(bytes(_referral)), "Cannot refer yourself!");
        require(_address2id[msg.sender] == 0, "Please remove referral field. You allready own the NFT.");
        require(_email2id[_email] == 0, "Email is already registered.");
        require(_email2id[_referral] != 0, "Referral email is not registered.");
        require(!allowTransfer, "No new minting at this stage");

        tokenCount ++;
        _safeMint(msg.sender, tokenCount);
        _address2id[msg.sender] = tokenCount;

        _id2email[tokenCount] = _email;
        _email2id[_email] = tokenCount;


        // couting the number of refferals
        referrals[_email2id[_referral]] ++;

        // refferenal number is linked to ID not address

        return(tokenCount);
    }

    function mint(string memory _email) external returns(uint256)
    {
        require(tokenCount < totalSupply, "Token Cap reached. Contact bell@st.world.");
        require(_email2id[_email] == 0, "Email is already registered.");
        require(!allowTransfer, "No new minting at this stage");

        // default value for address -> ID/any mapping is zero
        if(_address2id[msg.sender] == 0)
        {
            tokenCount ++;
            _safeMint(msg.sender, tokenCount);
            _address2id[msg.sender] = tokenCount;

            _id2email[tokenCount] = _email;
            _email2id[_email] = tokenCount;
        }
        else
        {
            // override email address for your existing NFT
            uint256 id = _address2id[msg.sender];
            string memory prevEmail = _id2email[id];
            _email2id[prevEmail] = 0;
            _id2email[id] = _email;
            _email2id[_email] = id;
        }

        return(tokenCount);
    }

    function increaseTokenCap(uint256 _amount) external
    {
        require(admin == msg.sender, "You are not admin.");
        totalSupply += _amount;
    }

    function changeAllowTransfer(bool allow) external
    {
        require(admin == msg.sender, "You are not admin.");
        allowTransfer = allow;
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal override {
        require(allowTransfer || from == address(0), "No transfer at this stage.");

        uint256 id = _address2id[from];
        _address2id[from] = 0;
        _address2id[to] = id;
    }

    function contractURI() public view returns (string memory) {
        return "https://st.world/nft/metadata.json";
    }

}

